import React, { Component } from 'react';
import { Routes,Route } from 'react-router-dom';

import './App.css';
import {AddUser} from './components/AddUser'

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Welcome to React Router!</h1>
        <Routes>
          <Route path="/" element={<AddUser/>} />
        </Routes>
      </div>
    );
  }
}

export default App;
